import zIndex from "@material-ui/core/styles/zIndex";

const background ="/images/Header.jpg";
const style = theme => ({
    mainheader:{
        height:"90vh",
        position:"relative",
        background:`url(${background})`,
        backgroundPosition: 'center',
        backgroundSize:"cover",
        backgroundColor:"red",
        zIndex:"55"
      },
    typo:{
      display:"flex",
      alignItems:"Center",
      justifyContent:'Center',
      color:"white",
      height:"100vh"
    }

});

export default style;
